import React from "react";
import TaskItem from "../TaskItem";



const TaskList = (props) => {

  return (

    props.todos.map((todo) => (

        <TaskItem
          key={todo.id}
          todo={todo}
          todos={props.todos}
          setTodos={props.setTodos}
          Todos={props.Todos}


        />
        )
        ))

}

        export default TaskList;
